/*Table structure for table `biz_enterprise` */

DROP TABLE IF EXISTS `biz_enterprise`;

CREATE TABLE `biz_enterprise` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `enterprise_id` varchar(11) NOT NULL COMMENT '所属企业id',
  `name` varchar(40) DEFAULT NULL COMMENT '企业名称',
  `number` varchar(120) DEFAULT NULL COMMENT '企业编号',
  `manager` varchar(10) DEFAULT NULL COMMENT '企业负责人',
  `phone` varchar(11) DEFAULT NULL COMMENT '联系电话',
  `desc` longtext COMMENT '企业简介',
  `grade` varchar(3) DEFAULT '0' COMMENT '评分',
  `lrr` int(11) DEFAULT NULL COMMENT '录入人',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `qyrs` varchar(5) DEFAULT NULL COMMENT '企业人数',
  `clsj` varchar(5) DEFAULT NULL COMMENT '成立时间',
  `qyxz` varchar(5) DEFAULT NULL COMMENT '企业性质',
  `zyyt` varchar(5) DEFAULT NULL COMMENT '主营业态',
  `jyzt` varchar(5) DEFAULT NULL COMMENT '经营状态（上一年）',
  `ltdjed` varchar(5) DEFAULT NULL COMMENT '猎头定金额度',
  `gzqy` varchar(5) DEFAULT NULL COMMENT '工作区域',
  `gltxjqcd` varchar(5) DEFAULT NULL COMMENT '管理体系健全程度',
  `nrylsl` varchar(5) DEFAULT NULL COMMENT '年人员流失率',
  `jxry` varchar(5) DEFAULT NULL COMMENT '奖项荣誉',
  `yqbzq` varchar(5) DEFAULT NULL COMMENT '需求保质期',
  `zltsl` varchar(5) DEFAULT NULL COMMENT '找猎头数量',
  `ldjf` varchar(5) DEFAULT NULL COMMENT '劳动纠纷',
  `swjf` varchar(5) DEFAULT NULL COMMENT '上午纠纷',
  `xytc` varchar(5) DEFAULT NULL COMMENT '选用套餐',
  `qtjfx` varchar(5) DEFAULT NULL COMMENT '其他加分项',
  `pjzf` tinyint(5) DEFAULT NULL COMMENT '企业评价总分',
  `logo` longblob COMMENT '企业logo',
  `qrcode` longblob COMMENT '企业二维码',
  `appcp` tinyint(1) DEFAULT '0' COMMENT '小程序测评标记 0:未测评，1:已测评',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=61 DEFAULT CHARSET=utf8 COMMENT='企业信息表';

