/*Table structure for table `biz_project` */

DROP TABLE IF EXISTS `biz_project`;

CREATE TABLE `biz_project` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `name` varchar(255) NOT NULL COMMENT '项目名称',
  `number` varchar(20) NOT NULL COMMENT '项目编号',
  `lxsj` date NOT NULL COMMENT '立项时间',
  `jssj` date DEFAULT NULL COMMENT '结束时间',
  `manager` int(10) NOT NULL COMMENT '项目经理',
  `members` varchar(600) DEFAULT NULL COMMENT '项目成员',
  `company` tinyint(2) NOT NULL COMMENT '所属公司',
  `grade` varchar(5) NOT NULL COMMENT '公司评分',
  `contacts` varchar(20) NOT NULL COMMENT '联系人',
  `phone` varchar(11) NOT NULL COMMENT '联系电话',
  `progress` varchar(600) DEFAULT NULL COMMENT '项目进度',
  `qrcode` blob COMMENT '二维码',
  `lrr` int(10) NOT NULL COMMENT '录入人',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `byzd1` varchar(128) DEFAULT NULL,
  `byzd2` varchar(128) DEFAULT NULL,
  `byzd3` varchar(128) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=71 DEFAULT CHARSET=utf8 COMMENT='项目表';

