/*Data for the table `biz_tc` */

insert  into `biz_tc`(`id`,`code`,`fwtd`,`td`,`gwbj`,`gzlc`,`zgwbj`,`zgzlc`) values (1,'A','猎头精英','单兵作战、简历推荐速度快','从事猎头行业3年以上;本科学历及以上;在企业担任过招聘主管的从业背景;沟通、理解能力强.','和企业方沟通岗位要求，了解岗位职责，了解企业基本情况;电话面试沟通，了解候选人基本情况和意愿;邀候选人到猎头公司进行初面;猎头顾问撰写人才评估报告，推荐给企业方;猎头顾问安排企业方与候选人面试;安排通过面试的候选人入职','从业背景、学历背景、资质经验、擅长领域','标准化、细致化、精准度、针对性、附加服务多样性'),(2,'B','猎头专家','团队作战、分工明确、精准、快速','企业管理工作经验8 年以上，从事猎头行业3 年以上;本科学历及以上;在企业担任过人力资源经理的从业背景;熟悉人力资源管理、企业运营管理理论知识和系统管理经验;有较强的项目管理经验，有分析企业问题，有提取岗位胜任力能力.','猎头顾问进入企业进行浅咨询后商议招聘计划;组织猎头项目组有计划、有步骤的实施猎头项目;猎头助理搜寻简历，并进行电话沟通;猎头项目经理邀约候选人到猎头公司进行初试，并根据候选人情况撰写评估报告;猎头项目经理和企业方商议复试题目及测评方式;猎头项目经理主持、组织在企业方进行复试;组织进行候选人终试;背景调查（根据企业要求）;协助候选人入职手续办理;企业方和候选人试用期跟踪','从业背景、学历背景、资质经验、擅长领域','标准化、细致化、精准度、针对性、附加服务多样性'),(3,'C','猎头专家、人才测评专家、企业顾问','资深顾问，团队作战；涉及管理咨询和人才测','企业咨询顾问工作经验8 年以上;猎头顾问从事企业管理工作5 年以上，从事猎头行业3 年以上;硕士研究生学历及以上;在企业担任过人力资源总监、企业运营总监以上高管;熟悉人力资源规划及落地，熟悉企业运营管理理论知识和系统管理经验;在行业内有深耕，熟悉对标企业，熟悉行业内企业的运营模式;有较强的项目管理经验，有解决企业管理问题经验，有提取岗位胜任力经验。','企业管理顾问和猎头顾问进入企业进行浅咨询、诊断企业现阶段问题，并根据目前市场数据提出组织架构、薪酬绩效体系建议;根据企业情况，编制《猎聘方案》，确定猎取对策;猎头项目经理建立专项猎头团队，有计划、有步骤的实施猎头项目;猎头助理搜寻简历，并进行40 分钟以上电话面试;猎头项目经理邀约候选人到猎头公司进行初试，由人力资源顾问、行业顾问对候选人进行测评，并根据候选人情况撰写评估报告;猎头项目经理和企业方商议复试阶段人才测评方式，进行测评题目设计、确定测评方式;猎头项目经理主持、组织在企业方进行人才测评，并完成人才解读;猎头项目经理组织企业意向候选人的终试;背景调查（根据企业要求）;协助候选人入职手续办理;企业方和候选人试用期跟踪，提出人才管理方案，辅助处理劳动关系纠纷','从业背景、学历背景、资质经验、擅长领域','标准化、细致化、精准度、针对性、附加服务多样性');

