  `cp_tc` int(11) DEFAULT NULL COMMENT '测评套餐',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=522 DEFAULT CHARSET=utf8 COMMENT='代码';

