/*Table structure for table `sys_user` */

DROP TABLE IF EXISTS `sys_user`;

CREATE TABLE `sys_user` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `role_id` int(10) NOT NULL COMMENT '角色ID',
  `enterprise_id` varchar(11) DEFAULT NULL COMMENT '企业代号',
  `name` varchar(50) NOT NULL COMMENT '名称',
  `user_name` varchar(50) NOT NULL COMMENT '用户名',
  `password` varchar(50) NOT NULL COMMENT '密码',
  `phone` varchar(11) DEFAULT NULL COMMENT '电话',
  `salt` varchar(50) NOT NULL COMMENT '盐值',
  `state` tinyint(1) NOT NULL COMMENT '状态(0：禁用，1：启用，2：锁定)',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `company` int(2) NOT NULL COMMENT '所属公司',
  `avatar` longblob NOT NULL COMMENT '头像地址',
  `sign` longtext COMMENT '用户签名',
  `is_show` tinyint(1) DEFAULT NULL COMMENT '是否显示(0:否，1：是)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_name` (`user_name`)
) ENGINE=InnoDB AUTO_INCREMENT=77 DEFAULT CHARSET=utf8 COMMENT='系统用户';

