/*Table structure for table `test_question_select` */

DROP TABLE IF EXISTS `test_question_select`;

CREATE TABLE `test_question_select` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `question_id` int(11) DEFAULT NULL COMMENT '测试问题表的id',
  `select_name` varchar(128) DEFAULT NULL COMMENT '选项名称',
  `select_value` varchar(11) DEFAULT NULL COMMENT '选项code值',
  `select_mark` varchar(11) DEFAULT NULL COMMENT '选项分值',
  `answer` varchar(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=241 DEFAULT CHARSET=utf8;

