/*Table structure for table `test_question_type` */

DROP TABLE IF EXISTS `test_question_type`;

CREATE TABLE `test_question_type` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `test_type_name` varchar(128) DEFAULT NULL COMMENT '测试方法（最大类型）',
  `test_type_header` longtext,
  `test_type_code` varchar(128) DEFAULT NULL COMMENT '测试方法描述',
  `test_question_type` varchar(128) DEFAULT NULL COMMENT '测试类型（测试方法的下属）',
  `test_question_type_name` varchar(128) DEFAULT NULL COMMENT '测试类型名称',
  `test_question_result` varchar(128) DEFAULT NULL,
  `back_img` longblob,
  `result_desc` longtext,
  `open_sign` int(11) DEFAULT '0' COMMENT '是否开放',
  `ymlx` int(11) DEFAULT '1' COMMENT '页面显示的类型',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

/*Data for the table `test_question_type` */

insert  into `test_question_type`(`id`,`test_type_name`,`test_type_header`,`test_type_code`,`test_question_type`,`test_question_type_name`,`test_question_result`,`back_img`,`result_desc`,`open_sign`,`ymlx`) values (1,'霍兰德测试','请根据对每一题目的第一印象作答,不必仔细推敲，答案没有好坏、对错之分。@具体填写方法是，根据自己的情况回答 “是”或“否”','hld','hldrglx','您能做好哪类工作？您做哪些工作天生就比别人强？您了解自己吗？无论您现在从事什么职业，都应该看看，自己到底喜欢做什么，适合做什么。','hldresult','http://192.168.20.39:8889/test/back_img/hldrglx.jpg','您各项指数得分，按高低依次筛选三项型态即为您的霍兰德职业兴趣类型。@\r\n注意：@\r\n① 您在某种职业类型中的总分越高，表明您越适合从事该职业环境的相关工作，得分最高的项就是最适合您的职业类型；@\r\n② 您在某个类型的得分越低，表明您越不适合从事该类型的职业。您在择业时应尽量避免选择得分最低的职业类型，因为该类型的工作与您的自我兴趣相差很远，可能会不利于您在工作中获得快乐和满足感并做出成绩；@\r\n③ 如果您有两种（或以上）的职业类型的得分相同，表明那两种（或以上）职业类型都比较符合您。相同得分类型可以自由组合，例如图中C/E和R同分，则为ACE/ACR/AEC/AER/ARE/ARC六种霍兰德类型都可为您的霍兰德类型。@部分组合类型没有推荐，说明是非典型兴趣类型，您可参考最高得分项开头的职业。\r\n',1,1),(2,'性格色彩测试','你接下来做的一切完全是为了你自己。@你唯一需要做的就是——面对真实的自己，所有问题没有好坏或对错之分，因此请一定要选择你“最自然的”反应，而不是你认为“最好的”或“最适合的”。@本测试共 30 题，每题只选一个答案，请耐心完成，准备好了吗？LET\'S GO！\r\n','xgcs','xgcslx','事物映入眼帘的第一感觉便是色彩，快来领取你的性格色彩，看看你的颜色意味着什么吧？','xgcsresult','http://192.168.20.39:8889/test/back_img/xgsclx.jpg','总分中数目最大的字母，是你的核心性格，也就是你天性中最重要的“动机”的性格。其他字母内的分数代表你整个性格中的比例。@\r\n如果某种颜色大于 15，说明你是典型的此类性格，如果有两种或三种数目非常接近，说明你是较复杂的组合性格。@\r\n基本性格有以下情况：@\r\n典型的红/蓝/黄/绿、红+黄、红+绿、蓝+黄、蓝+绿、黄+红、黄+蓝、绿+红、绿+蓝。@\r\n注意：@\r\n在性格组合当中，没有列出“红蓝配”（红+蓝、蓝+红）和“黄绿配”（黄+绿、绿+黄）的四种组合，是因为红与蓝、黄与绿是两对完全相反的性格。两种完全相反的性格共同组合在一人身上，必有另一个是受到强大的后天影响。这种人将在很多时候呈现极大的内心困惑。挖掘出真正的自己，对他们而言，是所有人中最迫切需要的！\r\n',1,2);

/*Table structure for table `test_user` */

