/*Table structure for table `test_user_mark` */

DROP TABLE IF EXISTS `test_user_mark`;

CREATE TABLE `test_user_mark` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_name` varchar(128) DEFAULT NULL COMMENT '用户姓名',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  `question_type_id` int(11) DEFAULT NULL COMMENT '测试题类型id',
  `test_result` varchar(1280) DEFAULT NULL,
  `cp_sign` int(11) DEFAULT NULL,
  `test_job` varchar(1280) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

